import {
  Icon,
  Rate,
  Dialog,
  Toast,
  Uploader,
  Calendar,
  Cell,
  Field,
  Popup,
  Picker,
  Button,
  DatetimePicker,
  Tab,
  Tabs,
  Search,
  CountDown,
  Swipe,
  SwipeItem,
} from 'vant';

Vue.use(Icon);
Vue.use(Rate);
Vue.use(Dialog);
Vue.use(Toast);
Vue.use(Uploader);
Vue.use(Calendar);
Vue.use(Cell);
Vue.use(Field);
Vue.use(Popup);
Vue.use(Picker);
Vue.use(Button);
Vue.use(DatetimePicker);
Vue.use(Tab);
Vue.use(Tabs);
